jQuery(document).ready(function(){
  /*open*/
  $('.header__icon').on('click',function(){
    $('.sidebar').css(
      'display','block'
    ).animate({
      right:'0'
    }, 
      300
    );
    $('.sidebar-bg').css(
      'display','block'
    ).animate({
      opacity:'0.5'
    },
      300
    )
  });
  /*close*/
  $('.sidebar__inner__icon').on('click',function(){
    $('.sidebar').animate({
      right:'-200px'
    },
      300
    );
    $('.sidebar-bg').animate({
      opacity:'0'
    },
      300
    );
    setTimeout(function(){
      $('.sidebar').css('display','none');
      $('.sidebar-bg').css('display','none');
    },
      300
    );
  });
});
/* side var */

$(function(){
  // 
  var duration = 300;

  // aside ----------------------------------------
  var $aside = $('.side__header > aside');
  var $asidButton = $aside.find('button')
      .on('click', function(){
          $aside.toggleClass('open'); /*届き*/
          if($aside.hasClass('open')){
              $aside.stop(true).animate({right: '-70px'}, duration, 'easeOutBack');
              $asidButton.find('img').attr('src', '/assets/btn_close.png');
          }else{
              $aside.stop(true).animate({right: '-390px'}, duration, 'easeInBack');
              $asidButton.find('img').attr('src', '/assets/btn_open.png');
          };
      });
});
